const Header = (props) => {
  return (
    <h1>{props.course}</h1>
  )
}

const Part = (props) => {
  return (
    <p>{props.part} {props.exercises}</p>
  )
}

const Content = (props) => {
  return (
    <div>
      props.part.forEach(val => {
        <Part part={val.name} exercises={val.exercises} />
      })
    </div>
  )
}

const Total = (props) => {
  return (
    <p>Number of exercises {props.count}</p>
  )
}

const App = () => {
  const course = 'half stack application dev'
  const parts = [
    {
      name: 'fundamentals of react',
      exercises: 20
    },
    {
      name: 'using props to pass data',
      exercises: 7
    },
    {
      name: 'state of a compement',
      exercises: 14
    }
  ]

  return (
    <div>
      <Header course={course} />
      <Content part={parts}/>
      <Total count={parts} />
    </div>
  )
}

export default App
